import Rank from './components/Rank/Rank'

class App extends Component{

  render(){
    return (
    <div className="App">

      <Navigation />
      <Logo />
      <Rank/>
      <ImageLinkForm />
      {/*<FaceRecognition />*/}


    </div>
    );
  }

}

export default App;
